import React from 'react';
import '../App.css';
import Navigation from './minor/Navigation'
import {Table} from 'react-bootstrap'

class Queue extends React.Component { 

  //the states of emotion and source will be set to null initially until the user had filled out the form.
  constructor() {
    super();
    this.state = {
      rows: []
    };
  }

  componentDidMount()
  {
    let self = this;
    var tempRows = [];
    fetch('https://spreadsheets.google.com/feeds/cells/18WAVyuKTaK6rdELGqWe_qiiCjGVTtJKHL0SWk6xLHDE/1/public/full?alt=json').then(res => 
    res.json()).then(data => {
      var index = 0;
      for(var i = 0; i < data['feed']['entry'].length; i+=3)
      {
       if(data['feed']['entry'][i]['gs$cell']['row'] === "1")
      {
        continue;
      }
      console.log(data['feed']['entry'][i]['gs$cell']['inputValue'])
      tempRows.push([
         data['feed']['entry'][i]['gs$cell']['inputValue'],
         data['feed']['entry'][i + 1]['gs$cell']['inputValue'],
         data['feed']['entry'][i + 2]['gs$cell']['inputValue']
      ])
      index++
      }

      self.setState({rows: tempRows})


    })

  }



  render()
  {  
    return (
      <div className="centerDiv">
        <Navigation></Navigation>
        <div className="contentWrapper">  
        <Table striped bordered>  
        <thead>
          <th>okaty</th>

          </thead>

        {this.state.rows.map((value, index) => <div>
          {((String(this.state.rows[index])).split(','))[0]}
          <br></br>
          {((String(this.state.rows[index])).split(','))[1]}
          <br></br>
          {((String(this.state.rows[index])).split(','))[2]}
          <br></br>
          <br></br>
          </div> 
        //((String(this.state.rows[index])).split(',')).map((innerValue, innerIndex) =>
          //((String(this.state.rows[index])).split(','))[innerIndex])
        )}
        </Table>
  {this.state.rows}

        </div>
      </div>
    )              
  }
}
export default Queue;
